             <img src={foto} alt='osmanhakan'/>
         </div>
         <div className='features-text'>
             <h2>suushieMods</h2>
             <h3>i quasi dolor.</h3>
             <button>Go to suushieMods</button>
             
             
             <h2>MUSCLE'S</h2>
